import React from 'react';
import { Link } from 'react-router-dom';

function AcademicsPopup() {
  const academics = [
    {
      name: 'Programs',
      links: [
        { name: 'Undergraduate', link: '/undergraduate' },
        { name: 'Postgraduate', link: '/postgraduate' },
        // ... more links
      ]
    },
    {
      name: '. . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . .  .',
      links: [
        { name: 'Academic Calendar', link: '/academic-calendar' },
        { name: 'Directorate of Continuing Education', link: '/director-continuing-education' },
        // ... more links
      ]
    },
    // ... other academic sections
  ];

  return (
    <div className="custom-popup">
      <div className="popup-column">
        <h3 className="title-name">Programs</h3>
        <ul>
          <li><Link className="small-text" to='/undergraduate'>Undergraduate</Link></li>
          <li><Link className="small-text" to='/postgraduate'>Postgraduate</Link></li>
        </ul>
      </div>
      <div className="popup-column">
        <h3 className="title-name">Directorates</h3>
        <ul>
        <li><Link className="small-text" to='/post-graduate-studies'>Directorate of Post Graduate Studies</Link></li>
          
          <li><Link className="small-text" to='/director-continuing-education'>Directorate of Continuing Education</Link></li>
        </ul>
      </div>
      <div className="popup-column">
        <h3 className="title-name">Additional Resources</h3>
        <ul>
        <li><Link className="small-text" to='/academic-calendar'>Academic Calendar</Link></li>
          <li><Link className="small-text" to='/research-innovation'>Office of the Research, Innovation and Commercialization</Link></li>
        </ul>
      </div>
    </div>
  );
}

export default AcademicsPopup;
